import React from "react";

function Page404() {
  return (
    <div className="error-page">
      <div>
        <h1 id="error-heading">404</h1>
        <h4>Not Found</h4>
        <p>The page you are trying to visit, doesn't exist</p>
      </div>
    </div>
  );
}

export default Page404;
